import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Veronica Hernandez</h1>
        <p>Personal Portfolio</p>
      </header>
      <main className="App-main">
        <section className="hero">
          <h2>Welcome to My Portfolio</h2>
          <p>This is a React-based personal portfolio website.</p>
        </section>
      </main>
    </div>
  );
}

export default App;
